import "./Profile.css";

function MyLangContents({ Lang, img }) {
  return (
    <div className="profile-data-content">
      <div className="profile-data-content-img">
        <img src={img} title={Lang} alt={Lang} />
      </div>
      <div className="profile-data-title">{Lang}</div>
    </div>
  );
}

const MyLanguage = [
  {
    Lang: "Python",
    img: "https://o.remove.bg/downloads/7ff0ab4a-9a13-4468-bb66-6e09988f2687/image-removebg-preview.png",
  },
  {
    Lang: "C",
    img: "https://o.remove.bg/downloads/500777d4-7dc2-4517-a135-8b76d04e34d6/image-removebg-preview.png",
  },
  {
    Lang: "Java Script",
    img: "data:image/png;base64,",
  },
  {
    Lang: "Html&CSS",
    img: "data:image/png;base64,",
  },
  {
    Lang: "Jquery",
    img: "https://o.remove.bg/downloads/4f20e6a7-7f90-445f-8b10-fecf165405e0/image-removebg-preview.png",
  },
  {
    Lang: "React",
    img: "https://o.remove.bg/downloads/7b9b5a45-53bc-49ec-b423-85206c93a3e8/image-removebg-preview.png",
  },
];

function Profile() {
  return (
    <section id="profile">
      <div className="profile-container">
        <div className="profile-data-container">
          <div className="profile-title font-style">내정보</div>
          <div className="profile-privacy-data-wrap">
            <div className="profile-privacy-img"></div>
            <div className="profile-privact-data font-style">
              <h5>이름 : 임동현</h5>
              <h5>나이 : 17</h5>
              <h5>소속 : 대구소프트웨어마이스터고등학교 1학년 재학중</h5>
              <h5>성격 : 포기하지 않고 섬세한 성격</h5>
            </div>
          </div>
        </div>
        <div className="profile-data-container">
          <div className="profile-title font-style">언어</div>
          <div className="profile-data-data">
            {MyLanguage.map((data) => (
              <MyLangContents Lang={data.Lang} img={data.img} />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
}

export default Profile;
